import Button from "./buttonEdit/Button";
import {useParams} from 'react-router-dom';
import Api from '../../services/api';
import {useEffect,  useState} from 'react';

export default function EditProfile() {

    const [specialization, setSpecialization] =  useState('');
    const [phone, setPhone] =  useState('');

    const {idUsuario} = useParams();
    
    useEffect(() => {

        const config = {
            headers:{
                Authorization:localStorage.getItem('token')
        }
        
    }

         async function getUsuario(){
             var response = await Api.get('updateUser/'+idUsuario, config)
             setSpecialization(response.data.specialization);
             setSpecialization(response.data.phone);
         } 
        
         getUsuario();
    },
[])
    
    
        return(
            <div>
                <h2>Tela de editar perfil</h2>
                <br/>
                <div>
                    <form className="form">
                    <text>Editar Perfil</text>
                    <br/>
                        <label>
                            Especificação:
                            <input type="text" 
                            onChange={e => setSpecialization(e.target.value)}/>
                        </label>
                        <br/>
                        <label>
                            Telefone:
                            <input type="text" 
                            onChange={e => setPhone(e.target.value)}/>
                        </label>
                        <div>
                        
                        <Button buttonSize='btn--large' type="submit">Editar</Button>
                        </div>
                    </form>
                    
                </div>
            </div>
        )
}
